CLASS_DEATHKNIGHT = "Les chevaliers de la mort sont d'anciens agents du Fléau, désormais alliés avec la Horde ou l'Alliance. Cette classe de héros débute le jeu à haut niveau. Le chevalier de la mort utilise des runes comme ressource principale, dont chacun des trois types est utilisé pour différentes techniques.|n|nIl dispose de plus de capacités à distance que la plupart des classes de corps à corps et privilégie les maladies et les dégâts infligés par ses familiers morts-vivants. Sa caractéristique principale est la Force, sans oublier l'Endurance pour les tanks.";
CLASS_DEATHKNIGHT_FEMALE = "Les chevaliers de la mort sont d'anciens agents du Fléau, désormais alliés avec la Horde ou l'Alliance. Cette classe de héros débute le jeu à haut niveau. Le chevalier de la mort utilise des runes comme ressource principale, dont chacun des trois types est utilisé pour différentes techniques.|n|nIl dispose de plus de capacités à distance que la plupart des classes de corps à corps et privilégie les maladies et les dégâts infligés par ses familiers morts-vivants. Sa caractéristique principale est la Force, sans oublier l'Endurance pour les tanks.";
CLASS_DISABLED = "Vous devez choisir une autre race si vous voulez jouer cette classe.";
CLASS_DRUID = "Les druides sont des changeformes ayant une affinité avec les plantes et les animaux. Il existe trois types de druides : le druide Équilibre, qui lance des sorts des Arcanes ou de Nature, le druide Farouche, qui peut prendre la forme d'un félin ou d'un ours pour combattre au corps à corps, et le druide Restauration, qui soigne ses alliés en utilisant des sorts de soins sur la durée. Les caractéristiques à privilégier dépendent du rôle du druide.";
CLASS_DRUID_FEMALE = "Les druides sont des changeformes ayant une affinité avec les plantes et les animaux. Il existe trois types de druides : le druide Équilibre, qui lance des sorts des Arcanes ou de Nature, le druide Farouche, qui peut prendre la forme d'un félin ou d'un ours pour combattre au corps à corps, et le druide Restauration, qui soigne ses alliés en utilisant des sorts de soins sur la durée. Les caractéristiques à privilégier dépendent du rôle du druide.";
CLASS_HUNTER = "Les chasseurs se sentent chez eux dans la nature et ont une affinité spéciale avec les animaux. Ils utilisent des armes à distance, comme l'arc, l'arbalète ou le fusil, ainsi que leur familier pour infliger des dégâts. Ils peuvent également installer des pièges pour infliger des dégâts ou maintenir un ennemi à distance. La caractéristique principale du chasseur est l'Agilité.";
CLASS_HUNTER_FEMALE = "Les chasseurs se sentent chez eux dans la nature et ont une affinité spéciale avec les animaux. Ils utilisent des armes à distance, comme l’arc, l’arbalète ou le fusil, ainsi que leur familier pour infliger des dégâts. Ils peuvent également installer des pièges pour infliger des dégâts ou maintenir un ennemi à distance. La caractéristique principale du chasseur est l’Agilité.";
