CLASS_MAGE = "Les mages sont les utilisateurs emblématiques de la magie en Azeroth, qui apprennent leur art au cours de leurs recherches et études approfondies. Ils portent des armures légères, mais compensent cette faiblesse par une puissante gamme de sorts offensifs et défensifs. Leur caractéristique principale est l'Intelligence.";
CLASS_MAGE_FEMALE = "Les mages sont les utilisateurs emblématiques de la magie en Azeroth, qui apprennent leur art au cours de leurs recherches et études approfondies. Ils portent des armures légères, mais compensent cette faiblesse par une puissante gamme de sorts offensifs et défensifs. Leur caractéristique principale est l'Intelligence.";
CLASS_MONK = "Les moines de la Pandarie antique ont développé leurs arts martiaux comme un moyen de résistance face à leurs anciens maîtres. Maintenant que les autres peuples d’Azeroth les ont redécouverts, les Pandarens ont commencé à propager auprès d’eux leur enseignement monastique. Les moines sont réputés pour leur habileté au combat à mains nues et comptent sur leurs poings et pieds autant que sur leurs armes. Les moines soigneurs sont des spécialistes de la médecine traditionnelle et deviennent souvent des chefs spirituels dans leurs communautés. La caractéristique principale du moine dépend de son rôle : Agilité pour les tanks et combattants en mêlée, Intelligence pour les soigneurs.";
CLASS_PALADIN = "Les paladins sont des combattants et défenseurs en armure lourde qui utilisent la magie du Sacré pour soigner les blessures et combattre le mal. Ils sont relativement autonomes et disposent de nombreuses techniques destinées à empêcher les morts. Le paladin peut choisir de se battre avec une arme à deux mains, de protéger avec un bouclier, ou de soigner. Ses caractéristiques principales dépendent du rôle choisi.";
CLASS_PALADIN_FEMALE = "Les paladins sont des combattants et défenseurs en armure lourde qui utilisent la magie du Sacré pour soigner les blessures et combattre le mal. Ils sont relativement autonomes et disposent de nombreuses techniques destinées à empêcher les morts. Le paladin peut choisir de se battre avec une arme à deux mains, de protéger avec un bouclier, ou de soigner. Ses caractéristiques principales dépendent du rôle choisi.";
CLASS_PRIEST = "Les prêtres disposent d'une grande palette d'outils pour soigner, mais ils peuvent également sacrifier leurs soins pour infliger des dégâts grâce à la magie de l'Ombre. En société, les prêtres endossent le rôle de guide spirituel de leurs races respectives. Les caractéristiques principales du prêtre sont l'Intelligence et l'Esprit (s'il s'est spécialisé dans les soins).";
CLASS_PRIEST_FEMALE = "Les prêtres disposent d'une grande palette d'outils pour soigner, mais ils peuvent également sacrifier leurs soins pour infliger des dégâts grâce à la magie de l'Ombre. En société, les prêtres endossent le rôle de guide spirituel de leurs races respectives. Les caractéristiques principales du prêtre sont l'Intelligence et l'Esprit (s'il s'est spécialisé dans les soins).";
CLASS_ROGUE = "Les voleurs endossent souvent le rôle d'assassin ou d'éclaireur, mais nombre d'entre eux sont des loups solitaires. Ils sont doués pour l'ambidextrie avec une large gamme d'armes, la dague étant la plus représentative de cette classe.|n|nLes voleurs peuvent se déplacer furtivement autour de leurs ennemis ou attaquer un adversaire dans le dos pour tenter de l'achever rapidement. Leur caractéristique principale est l'Agilité.";
CLASS_ROGUE_FEMALE = "Les voleurs endossent souvent le rôle d'assassin ou d'éclaireur, mais nombre d'entre eux sont des loups solitaires. Ils sont doués pour l'ambidextrie avec une large gamme d'armes, la dague étant la plus représentative de cette classe.|n|nLes voleurs peuvent se déplacer furtivement autour de leurs ennemis ou attaquer un adversaire dans le dos pour tenter de l'achever rapidement. Leur caractéristique principale est l'Agilité.";
CLASS_SHAMAN = "Les chamans invoquent la puissance des éléments pour améliorer les dégâts de leurs armes ou sorts. Ils invoquent des totems en combat pour octroyer des améliorations, soigner ou infliger des dégâts à leurs ennemis. Les chamans ont souvent un rôle de guide spirituel dans les communautés tribales. Leurs caractéristiques principales dépendent de leur rôle.";
CLASS_SHAMAN_FEMALE = "Les chamans invoquent la puissance des éléments pour améliorer les dégâts de leurs armes ou sorts. Ils invoquent des totems en combat pour octroyer des améliorations, soigner ou infliger des dégâts à leurs ennemis. Les chamans ont souvent un rôle de guide spirituel dans les communautés tribales. Leurs caractéristiques principales dépendent de leur rôle.";
CLASS_WARLOCK = "Les démonistes utilisent la magie du Feu ou de l’Ombre pour infliger des dégâts, drainer ou maudire leurs ennemis. Ils peuvent également invoquer des démons qui leur obéissent. Les démonistes peuvent convertir leur vie en mana ou invoquer à eux des membres de leur groupe.\n\nSi certaines sociétés de l’Alliance craignent les démonistes, certains peuples de la Horde les considèrent comme de grands chefs. Ce lanceur de sorts favorisera en priorité l’Intelligence.";
CLASS_WARLOCK_FEMALE = "Les démonistes utilisent la magie du Feu ou de l’Ombre pour infliger des dégâts, drainer ou maudire leurs ennemis. Ils peuvent également invoquer des démons qui leur obéissent. Les démonistes peuvent convertir leur vie en mana ou invoquer à eux des membres de leur groupe.\n\nSi certaines sociétés de l’Alliance craignent les démonistes, certains peuples de la Horde les considèrent comme de grands chefs. Ce lanceur de sorts favorisera en priorité l’Intelligence.";
CLASS_WARRIOR = "Les guerriers portent une armure en plaques et aspirent à la perfection dans les combats. Lorsqu'ils infligent des dégâts, ils génèrent de la rage, utilisée pour alimenter leurs attaques spéciales. \n\nCes combattants peuvent choisir de se spécialiser dans le port d'armes à deux mains, d'armes à une main, ou dans l'utilisation du bouclier en plus d'une arme à une main. Ils disposent de plusieurs techniques qui leur permettent de se déplacer rapidement sur le champ de bataille. Leur caractéristique principale est la Force, mais les tanks s'intéresseront également à l'Endurance.";
CLASS_WARRIOR_FEMALE = "Les guerriers portent une armure en plaques et aspirent à la perfection dans les combats. Lorsqu'ils infligent des dégâts, ils génèrent de la rage, utilisée pour alimenter leurs attaques spéciales.\n Ces combattants peuvent choisir de se spécialiser dans le port d'armes à deux mains, d'armes à une main, ou dans l'utilisation du bouclier en plus d'une arme à une main. Ils disposent de plusieurs techniques qui leur permettent de se déplacer rapidement sur le champ de bataille. Leur caractéristique principale est la Force, mais les tanks s'intéresseront également à l'Endurance.";
